const Dive = ({ dive }) => {


  if (!dive) {
    return null
}

  const date = new Date(dive.date).toLocaleString()

  return (
      <div className="dive">
          <h3>Dive {dive.diveNum} {date}</h3>
          <p>{dive.notes}</p>
      </div>
  )
}

export default Dive
